Meteor and GroundDB: find by id not returning any entries<p>I am trying to implement an offline DB for my meteor app and chose to use <strong>“GroundDB”</strong>. Now I am still in my early learning phases but I am having a problem for which I cannot find a solution:</p>

<p>when using .find on my offline-collections, <strong>I cannot find by id</strong>. Every other property works. A typical object from my mongo DB will look like this:</p>

<p><code>{_id:"…someid", name:“test”, description:“test”, systemId:"…someID"};</code></p>

<p>I can find by name, description and even systemID, but finding by _id is always giving back 0 results.</p>

<p>What could cause this behaviour?</p>

<p>This is only for GroundDB. Finding by _id in mongo database works. Also, the “_id” field in GroundDB is there! When doing a <code>.find({})</code> without filters, I can see that all properties, including the _id-field, get copied to groundb.</p>

<h2>Edit</h2>

<p>My current code regarding groundDB looks as follows:</p>

<pre><code>ExampleCol = new Mongo.Collection('exampleCol');


if (Meteor.isServer) {
  Meteor.publish('exampleCol', functionexampleColPublication() {
    return ExampleCol.find();
  });
}
</code></pre>

<p>On Client:</p>

<pre><code>ExampleCol_GROUND = new Ground.Collection('exampleCol'
  });
ExampleCol_GROUND.observeSource(ExampleCol.find());
</code></pre>

<p>And then: 
 <code>ExampleCol_GROUND.find()</code> returns all entries, that are also in  ExampleCol. I just cannot <code>ExampleCol_GROUND.find({_id:"..."})</code> (0 results)</p>

