I tried using Populate in mongoose but it didn't work<p>Hello everyone i am in a problem, may be you can help me.
So basically i have created <strong>two collection</strong> in mongoose, <strong>one for user details</strong> when they sign Up or login and <strong>other for Recipe they post.</strong>
I also want to save the each recipe a user post in the user collection (like populate property of mongoose). like if user1 post a recipe1 then it should save in the recipe collection and also in the user data who posted this.
I tried to use <strong>Populate method</strong> for this as shown in the code below but when ever i post some recipe it stored in recipe collection only and the "posts" key in the users collection is always empty. I want to save the recipe in the "posts" key of the users collection also. 
Please Guide me how to do this.</p>

<pre><code>require('dotenv').config()
const express = require("express");
const bodyParser = require("body-parser");
