  destination: (req, file, cb) =&gt; {
    cb(null, "public/img/uploads")
  },
  filename: (req, file, cb) =&gt; {
    cb(null, file.fieldname + '-' + Date.now() + path.extname(file.originalname));
  }
});

var upload = multer({
  storage: storage,
  limits: {
    fileSize: 5 * 1024 * 1024
  }
});


app.use((req, res, next) =&gt; {
