      username: req.body.username,
      password: req.body.password
    });
    req.login(user, (err) =&gt; {
      if (err) {
        console.log(err);
      } else {
        passport.authenticate("local")(req, res, () =&gt; {
          res.redirect("/");
        });
      }
    });
  })

app.listen(process.env.PORT || 5000, function() {
  console.log("server is running on port 5000");
});

</code></pre>; Answer: Well it is really on a case by case basis. In theory, SELECT's should *always* return a query object. Unless something is interfering... like if the query contains multiple sql statements, so we would need to see the actual query. As an aside, do not use # signs with isDefined. That function expects the *name* of a variable, ie a string. As I mentioned [in the comments](http://stackoverflow.com/questions/6379730/check-query-results-if-no-data-is-returned#comment7473686_6379730), using # signs means causes the variable to be evaluated, triggering the very error you are trying to prevent :)

