How to find a result and apply localization in MongoDB?<p>Given the following sample data</p>

<pre><code>db.cars.insertMany([
    {
        "category": "sedan",
        "model": {
            "manufacturer": {
                "en": "Mercedes",
                "ru": "Мерседес"
            },
            "number": "E320"
        }
    },
    {
        "category": "SUV",
        "model": {
            "manufacturer": {
                "en": "Audi",
                "ru": "Ауди"
            },
            "number": "Q7"
        }
    },

])
</code></pre>

<p>I can select a category by its' name with the following query</p>

<pre><code>db.cars.find({'category': 'sedan'})
</code></pre>

<p>And also, if I want to do mapping for a given field, I can do the following</p>

<pre><code>db.cars.aggregate({$project: {'model.manufacturer': '$model.manufacturer.ru'}})
</code></pre>

<p>Now combining those 2, I get</p>

<pre><code> db.cars.aggregate([{$match: {'category': 'SUV'}}, {$project: {'model.manufacturer': '$model.manufacturer.ru'}}])
</code></pre>

<p>Now my question is, is this a right approach, and if yes, how do I keep all the other values without typing them in the aggregation query(like <code>{'model': 1, ... }</code>)</p>

